import React from 'react';

class User extends React.Component {
  render()
    {
      return (
        <div>
        <form onSubmit={this.props.userMethod}>
          <input type="text" name="id" />
          <button>Получить информацию</button>
        </form>
        <div>
          {this.props.firstName &&
            <div>
              <div>ID страницы: {this.props.id}</div>
              <div>Имя: {this.props.firstName}</div>
              <div>Фамилия: {this.props.lastName}</div>
              <div>Дата рождения: {this.props.bdate}</div>
              <div>
                {this.props.sex===2 && <div>Пол: мужской</div>}
                {this.props.sex===1 && <div>Пол: женский</div>}
                {this.props.sex===0 && <div>Пол: не указан</div>}
              </div>
              <div>Фото: <img src={this.props.photo}/></div>
            </div>
          }
        </div>
        </div>
      )
    }
}

export default User
